import React from 'react'

const SummaryPage = () => {
  return (
    <div>
        <form>
            <input 
                type='checkbox' 
                checked={false}
                id="confirm-checkbox"
            />{" "}
            <label htmlFor='confirm-checkbox'>
                주문하려는 것을 확인하셨나요?
            </label>
        </form>
    </div>
  )
}

export default SummaryPage
